// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";

contract MultiCollectionMarketplace is Ownable, ReentrancyGuard {
  enum Phase {
    Paused,
    Whitelist,
    FCFS,
    Public
  }

  struct Collection {
    address nftContract;
    address creator;
    Phase currentPhase;
    bytes32 whitelistRoot;
    bool isActive;
    uint256 marketplaceFee; // in basis points (e.g., 250 = 2.5%)
  }

  struct PhaseConfig {
    uint256 startTime;
    uint256 endTime;
    uint256 price;
    uint256 maxPerWallet;
    bool isActive;
  }

  struct Listing {
    uint256 listingId;
    address nftContract;
    uint256 tokenId;
    address seller;
    uint256 price;
    bool isActive;
    Phase requiredPhase; // Minimum phase required to purchase
  }

  // Direct counters replacement
  uint256 private _listingIdCounter;
  uint256 private _collectionIdCounter;

  // Mappings
  mapping(address => Collection) public collections; // nftContract => Collection
  mapping(address => mapping(Phase => PhaseConfig)) public phaseConfigs; // nftContract => Phase => Config
  mapping(uint256 => Listing) public listings; // listingId => Listing
  mapping(address => mapping(address => mapping(Phase => uint256)))
    public purchaseCounts; // buyer => collection => phase => count

  // Events
  event CollectionRegistered(
    address indexed nftContract,
    address indexed creator
  );
  event PhaseConfigured(
    address indexed nftContract,
    Phase phase,
    uint256 startTime,
    uint256 endTime,
    uint256 price
  );
  event PhaseChanged(address indexed nftContract, Phase newPhase);
  event ListingCreated(
    uint256 indexed listingId,
    address indexed nftContract,
    uint256 tokenId,
    uint256 price
  );
  event ListingSold(
    uint256 indexed listingId,
    address indexed buyer,
    uint256 price
  );
  event ListingCancelled(uint256 indexed listingId);

  constructor(address initialOwner) Ownable(initialOwner) {
    // Initialize counters at 0
    _listingIdCounter = 0;
    _collectionIdCounter = 0;
  }

  // Register a new NFT collection
  function registerCollection(
    address nftContract,
    address creator,
    bytes32 whitelistRoot,
    uint256 marketplaceFee
  ) external onlyOwner {
    require(
      !collections[nftContract].isActive,
      "Collection already registered"
    );
    require(marketplaceFee <= 1000, "Fee too high"); // Max 10%

    _collectionIdCounter++;

    collections[nftContract] = Collection({
      nftContract: nftContract,
      creator: creator,
      currentPhase: Phase.Paused,
      whitelistRoot: whitelistRoot,
      isActive: true,
      marketplaceFee: marketplaceFee
    });

    emit CollectionRegistered(nftContract, creator);
  }

  // Create a new listing
  function createListing(
    address nftContract,
    uint256 tokenId,
    uint256 price,
    Phase requiredPhase
  ) external nonReentrant {
    require(collections[nftContract].isActive, "Collection not registered");
    require(price > 0, "Price must be greater than zero");

    IERC721 nft = IERC721(nftContract);
    require(nft.ownerOf(tokenId) == msg.sender, "Not token owner");
    require(
      nft.getApproved(tokenId) == address(this) ||
        nft.isApprovedForAll(msg.sender, address(this)),
      "Marketplace not approved"
    );

    _listingIdCounter++;
    uint256 newListingId = _listingIdCounter;

    listings[newListingId] = Listing({
      listingId: newListingId,
      nftContract: nftContract,
      tokenId: tokenId,
      seller: msg.sender,
      price: price,
      isActive: true,
      requiredPhase: requiredPhase
    });

    emit ListingCreated(newListingId, nftContract, tokenId, price);
  }

  // Purchase a listed NFT
  function purchaseListing(
    uint256 listingId,
    bytes32[] calldata whitelistProof
  ) external payable nonReentrant {
    Listing storage listing = listings[listingId];
    require(listing.isActive, "Listing not active");

    Collection storage collection = collections[listing.nftContract];
    PhaseConfig storage phaseConfig = phaseConfigs[listing.nftContract][
      collection.currentPhase
    ];

    require(
      collection.currentPhase >= listing.requiredPhase,
      "Phase not active"
    );
    require(block.timestamp >= phaseConfig.startTime, "Phase not started");
    require(block.timestamp <= phaseConfig.endTime, "Phase ended");
    require(msg.value >= listing.price, "Insufficient payment");

    // Phase-specific checks
    if (collection.currentPhase == Phase.Whitelist) {
      require(
        _isWhitelisted(msg.sender, whitelistProof, collection.whitelistRoot),
        "Not whitelisted"
      );
    }

    // Check purchase limits
    require(
      purchaseCounts[msg.sender][listing.nftContract][collection.currentPhase] <
        phaseConfig.maxPerWallet,
      "Exceeds wallet limit"
    );

    // Update purchase count
    purchaseCounts[msg.sender][listing.nftContract][collection.currentPhase]++;

    // Process purchase
    listing.isActive = false;

    // Calculate fees
    uint256 marketplaceFee = (listing.price * collection.marketplaceFee) /
      10000;
    uint256 sellerProceeds = listing.price - marketplaceFee;

    // Transfer NFT
    IERC721(listing.nftContract).transferFrom(
      listing.seller,
      msg.sender,
      listing.tokenId
    );

    // Transfer payments
    payable(listing.seller).transfer(sellerProceeds);
    payable(owner()).transfer(marketplaceFee);

    emit ListingSold(listingId, msg.sender, listing.price);

    // Refund excess payment
    uint256 excess = msg.value - listing.price;
    if (excess > 0) {
      payable(msg.sender).transfer(excess);
    }
  }

  // Helper function to verify whitelist status
  function _isWhitelisted(
    address user,
    bytes32[] calldata proof,
    bytes32 root
  ) internal pure returns (bool) {
    bytes32 leaf = keccak256(abi.encodePacked(user));
    return MerkleProof.verify(proof, root, leaf);
  }

  // Configure a phase for a collection
  function configurePhase(
    address nftContract,
    Phase phase,
    uint256 startTime,
    uint256 endTime,
    uint256 price,
    uint256 maxPerWallet
  ) external {
    Collection storage collection = collections[nftContract];
    require(collection.isActive, "Collection not registered");
    require(
      msg.sender == collection.creator || msg.sender == owner(),
      "Not authorized"
    );
    require(startTime < endTime, "Invalid time range");

    phaseConfigs[nftContract][phase] = PhaseConfig({
      startTime: startTime,
      endTime: endTime,
      price: price,
      maxPerWallet: maxPerWallet,
      isActive: true
    });

    emit PhaseConfigured(nftContract, phase, startTime, endTime, price);
  }

  // Change collection phase
  function setPhase(address nftContract, Phase newPhase) external {
    Collection storage collection = collections[nftContract];
    require(
      msg.sender == collection.creator || msg.sender == owner(),
      "Not authorized"
    );
    require(collection.isActive, "Collection not registered");

    collection.currentPhase = newPhase;
    emit PhaseChanged(nftContract, newPhase);
  }

  // Cancel listing
  function cancelListing(uint256 listingId) external {
    Listing storage listing = listings[listingId];
    require(listing.isActive, "Listing not active");
    require(listing.seller == msg.sender, "Not seller");

    listing.isActive = false;
    emit ListingCancelled(listingId);
  }

  // Update whitelist root
  function updateWhitelistRoot(address nftContract, bytes32 newRoot) external {
    Collection storage collection = collections[nftContract];
    require(
      msg.sender == collection.creator || msg.sender == owner(),
      "Not authorized"
    );
    collection.whitelistRoot = newRoot;
  }

  // View functions
  function getCollection(
    address nftContract
  ) external view returns (Collection memory) {
    return collections[nftContract];
  }

  function getPhaseConfig(
    address nftContract,
    Phase phase
  ) external view returns (PhaseConfig memory) {
    return phaseConfigs[nftContract][phase];
  }

  function getListing(
    uint256 listingId
  ) external view returns (Listing memory) {
    return listings[listingId];
  }

  function getCurrentListingId() external view returns (uint256) {
    return _listingIdCounter;
  }

  function getCurrentCollectionId() external view returns (uint256) {
    return _collectionIdCounter;
  }
}

